import { configureStore, getDefaultMiddleware } from "@reduxjs/toolkit"
import adminAdvertisementReducer from "./features/admin/advertisementSlice"


export const store = configureStore({
                        reducer: {
                                admin: adminAdvertisementReducer
                        }
                })
